'%{
\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOn those evenings when he had no public functions to attend, he would sequester himself in his library at home to answer letters, consult the statute books, memorize lines of poetry, study a foreign language, or practice the jokes that, however hard he tried, he could never gracefully deliver.\n\nNovember 25, 2014\n\u001c39\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAmbition is a passion, at once strong and insidious, and is very apt to cheet a man out of his happiness and his true respectability of character.\n\nNovember 25, 2014\n\u001c50\n\u0011\n\u0011\n\n\n2 The “Longing to Rise”\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHenry was singled out among his brothers for a college education, “then regarded, by every family,” he later wrote, “as a privilege so high and so costly that not more than one son could expect it.”\n\nNovember 25, 2014\n\u001c57\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cALMON P ORTLAND C HASE, in contrast to the ever buoyant Seward, possessed a restless soul incapable of finding satisfaction in his considerable achievements. He was forever brooding on a station in life not yet reached\n\nNovember 25, 2014\n\u001c63\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe had discovered the pride and pleasure an attentive audience could bestow. This great storytelling talent and oratorical skill would eventually constitute his stock-in-trade throughout both his legal and political careers.\n\nNovember 26, 2014\n\u001c86\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNo qualification was ever required of a teacher,” Lincoln recalled, “beyond ‘readin, writin, and cipherin,’ to the Rule of Three. If a straggler supposed to understand latin, happened to sojourn in the neighborhood, he was looked upon as a wizzard.”\n\nI should put in writing the principles I stand by as a teacher. Can\u0027t have no qualifications that does nothing for the kid\n\nNovember 26, 2014\n\u001c86\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAt a time when ownership of books remained “a luxury for those Americans living outside the purview of the middle class,” gaining access to reading material proved difficult\n\nNovember 26, 2014\n\u001c87\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen printing was first invented, Lincoln would later write, “the great mass of men…were utterly unconscious, that their conditions, or their minds were capable of improvement.” To liberate “the mind from this false and under estimate of itself, is the great task which printing came into the world to perform.”\n\nNovember 26, 2014\n\u001c87\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNor would his community understand the thoughts and emotions stirred by his reading; there were few to talk to about the most important and deeply experienced activities of his mind.\n\nNovember 26, 2014\n\u001c90\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cGet the books, and read and study them,” he told a law student seeking advice in 1855. It did not matter, he continued, whether the reading be done in a small town or a large city, by oneself or in the company of others. “The books, and your capacity for understanding them, are just the same in all places…. Always bear in mind that your own resolution to succeed, is more important than any other one thing.”\n\nNovember 26, 2014\n\u001c92\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOnly people who are capable of loving strongly,” Leo Tolstoy wrote, “can also suffer great sorrow; but this same necessity of loving serves to counteract their grief and heal them.”\n\nNovember 26, 2014\n\u001c94\n\u0011\n\u0011\n\n\n3 The Lure of Politics\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cCitizens assemble with the sole goal of declaring that they disapprove of the course of government,” Tocqueville wrote. “To meddle in the government of society and to speak about it is the greatest business and, so to speak, the only pleasure that an American knows….\n\nNovember 27, 2014\n\u001c100\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe argued that America owed all the benefits of citizenship to these new arrivals, who helped power the engine of Northern expansion. In particular, he proposed to reform the school system, where the virulently anti-Catholic curriculum frightened immigrants away, dooming vast numbers to illiteracy, poverty, and vice.\n\nJanuary 24, 2015\n\u001c131\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1Theu2h_vwl11GHsrBVu6VGKNsiKqiM6UcKhSwzs","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"15I6exheqg9AzKnc22oBzgUE3nn9xerA6abu_fMA","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":nul