a":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4150,"ei":4156,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="kTU5e09L7w6CvUJEO5yIParZBnE"  nonce="kTU5e09L7w6CvUJEO5yIParZBnE">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="kTU5e09L7w6CvUJEO5yIParZBnE"  nonce="kTU5e09L7w6CvUJEO5yIParZBnE">DOCS_modelChunk = [{"ty":"is","ibi":4157,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“I was born and have ever remained in the most humble walks of life. I have no wealthy or popular relations to recommend me. My case is thrown exclusively upon the independent voters of this county, and if elected they will have conferred a favor upon me, for which I shall be unremitting in my labors to compensate.\n\nJanuary 24, 2015\n\u001c137\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThough his face, in repose, revealed nothing “marked or Striking,” when animated by a story, “Several wrinkles would diverge from the inner corners of his eyes, and extend\n\nJanuary 24, 2015\n\u001c139\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdown and diagonally across his nose, his eyes would Sparkle, all terminating in an unrestrained Laugh in which every one present willing or unwilling were compelled to take part.” This rapid illumination of Lincoln’s features in conversation would be observed by countless others throughout his entire life, drawing many into his orbit\n\nJanuary 24, 2015\n\u001c139\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo Lincoln’s mind, the fundamental test of a democracy was its capacity to “elevate the condition of men, to lift artificial weights from all shoulders, to clear the paths of laudable pursuit for all.” A real democracy would be a meritocracy where those born in the lower ranks could rise as far as their natural talents and discipline might take them.\n\nGrow and democracy - I have similar visions for both.\n\nJanuary 24, 2015\n\u001c142\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe awkward dissolution of his engagement to Mary and the anticipated loss of his best friend combined with the collapse of the internal improvement projects and the consequent damage to his reputation to induce a state of mourning that deepened for weeks. He stopped attending the legislature and withdrew from the lively social life he had enjoyed. His friends worried that he was suicidal. According to Speed, “Lincoln went Crazy—had to remove razors from his room—take away all Knives and other such dangerous things—\u0026c—it was terrible.” He was “delirious to the extent of not knowing what he was doing,”\n\nJanuary 24, 2015\n\u001c153\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFueled by his resilience, conviction, and strength of will, Lincoln gradually recovered from his depression. He understood, he told Speed later, that in times of anxiety it is critical to “avoid being idle,” that “business and conversation of friends” were necessary to give the mind “rest from that intensity of thought, which will some times wear the sweetest idea threadbare and turn it to the bitterness of death.”\n\nJanuary 24, 2015\n\u001c155\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cConscious of his superior powers and the extraordinary reach of his mind and sensibilities, Lincoln had feared from his earliest days that these qualities would never find fulfillment or bring him recognition among his fellows. Periodically, when the distance between his lofty ambition and the reality of his circumstances seemed unbridgeable, he was engulfed by tremendous sadness. If he rarely spoke of his inner feelings, he often expressed emotions through the poetry he admired. Gray’s “Elegy,” which Lincoln quoted in his small autobiography to explain his attitude toward his childhood poverty, asserts that “Full many a flower is born to blush unseen/And waste its sweetness on the desert air.”\n\nJanuary 25, 2015\n\u001c158\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ctalent. “Here rests his head upon the lap of earth/A youth to fortune and to fame unknown/Fair Science frowned not on his humble birth/And Melancholy marked him for her own.”\n\nJanuary 24, 2015\n\u001c158\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cModern psychiatry regards humor as probably the most mature and healthy means of adapting to melancholy. “Humor, like hope, permits one to focus upon and to bear what is too terrible to be borne,” writes George Valliant. “Humor can be marvelously therapeutic,” adds another observer. “It can deflate without destroying; it can instruct while it entertains;\n\nJanuary 24, 2015\n\u001c160\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn a world environed by cruelty and injustice, Lincoln’s remarkable empathy was inevitably a source of pain. His sensibilities were not only acute, they were raw. “With his wealth of sympathy, his conscience, and his unflinching sense of justice, he was predestined to sorrow,”\n\nJanuary 24, 2015\n\u001c161\n\u0011\n\u0011"},{"ty":"te","id":"i.14","spi":4166},{"ty":"te","id":"i.15","spi":4521},{"ty":"te","id":"i.16","spi":4731},{"ty":"te","id":"i.17","spi":5105},{"ty":"te","id":"i.18","spi":5551},{"ty":"te","id":"i.19","spi":6198},{"ty":"te","id":"i.20","spi":6655},{"ty":"te","id":"i.21","spi":7397},{"ty":"te","id":"i.22","spi":7610},{"ty":"te","id":"i.23","spi":8005},{"ty":"as","st":"paragraph","si":4157,"ei":4157,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i