script type="text/javascript" nonce="kTU5e09L7w6CvUJEO5yIParZBnE"  nonce="kTU5e09L7w6CvUJEO5yIParZBnE">DOCS_modelChunk = [{"ty":"is","ibi":8312,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHis crowning gift of political diagnosis,” suggested Nicolay, “was due to his sympathy…which gave him the power to forecast with uncanny accuracy what his opponents were likely to do.\n\nJanuary 24, 2015\n\u001c161\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAs the mob surged forward, Chase braced his arms against the door frame, blocking the hotel’s entrance with his body. Six feet two, with broad shoulders, a massive chest, and a determined set to his jaw, Chase gave the rioters pause. The crowd demanded to know who he was. “Salmon P. Chase,” the young lawyer replied. “You will pay for your actions,” a frustrated member of the mob told him. “I [can] be found at any time,” Chase said. “His voice and commanding presence caught the mood of the mob at just the right time,” his biographer observes. The hour was late and the mob backed off. The dramatic encounter had a profound effect on Chase. He became a hero in the antislavery community and began to see his future in a different way. In the years that followed, he became a leader in the effort to protect antislavery activists\n\nJanuary 25, 2015\n\u001c167\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“By dedicating himself to moral activism,” the historian Stephen Maizlish argues, “Chase could join his passion for personal advancement to the demands of his religious convictions…. ‘Fame’s proud temple’ could be his and he need feel no guilt in its pursuit.”\n\nJanuary 25, 2015\n\u001c168\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 25, 2015\n\u001c168\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou have great gifts of God, energy, enthusiasm, talent, utterance. And now a great cause demands you.”\n\nJanuary 25, 2015\n\u001c179\n\u0011\n\u0011\n\n\n4 “Plunder \u0026 Conquest”\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen you were here,” Lincoln wrote Mary on April 16, 1848, “I thought you hindered me some in attending to business; but now, having nothing but business—no variety—it has grown exceedingly tasteless to me…I hate to stay in this old room by myself.”\n\nJanuary 25, 2015\n\u001c189\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMy dear Husband,” Mary answered, writing on a Saturday night after the children were asleep. “How much, I wish instead of writing, we were together this evening, I feel very sad away from you.”\n\nJanuary 25, 2015\n\u001c189\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf I have one vice,” he later quipped, “and I can call it nothing else,—it is not to be able to say no!\n\nJanuary 25, 2015\n\u001c196\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHad he married “a woman of more angelic temperament,” Springfield lawyer Milton Hay speculated, “he, doubtless, would have remained at home more and been less inclined to mingle with people outside.” Though a tranquil domestic union might have made Lincoln a happier man, the supposition that he would have been a contented homebody, like Edward Bates, belies everything we know of Lincoln’s fierce ambition and extraordinary drive—an ambition that drove him to devour books in every spare moment, memorize his father’s stories in order to captivate his friends, study law late into the night after a full day’s work, and run for office at the age of twenty-three.\n\nJanuary 25, 2015\n\u001c200\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSeward stood before his Cleveland audience and called for the abolition of the black codes that prevented blacks from voting, sitting on juries, or holding office in Ohio. Slavery, he conceded, was once the sin of all the states. “We in New York are guilty of slavery still, by withholding the right of suffrage from the race we have emancipated. You in Ohio are guilty in the same way, by a system of black-laws still more aristocratic and odious.” Seward’s support that day for the black vote, black presence on juries, and black officeholding was startlingly radical for a mainstream politician. Even a full decade later, during his debates with Stephen Douglas, Abraham Lincoln would maintain that he had never been in favor “of making voters or jurors of negroes, nor of qualifying them to hold office, nor to intermarry\n\nJanuary 25, 2015\n\u001c201\n\u0011\n\u0011\n\n\n5 The Turbulent Fifties\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe principal weapon of political combatants was the speech. A gift for oratory was the key to success in politics. Even as a child, Lincoln had honed his skills by addressing his companions from a tree stump. Speeches on important occasions were exhaustively researched and closely reasoned, often lasting three or four hours. There was demagoguery, of course, but there were also metaphors and references to literature and classical history\n\nJanuary 25, 2015\n\u001c211\n\u0011\n\u0011"},{"ty":"te","id":"i.24","spi":8321},{"ty":"te","id":"i.25","spi":8543},{"ty":"te","id":"i.26","spi":9414},{"ty":"te","id":"i.27","spi":9713},{"ty":"te","id":"i.28","spi":9750},{"ty":"te","id":"i.29","spi":9917},{"ty":"te","id":"i.30","spi":10205},{"ty":"te","id":"i.31","spi":10437},{"ty":"te","id":"i.32","spi":10579},{"ty":"te","id":"i.33","spi":11282},{"ty":"te","id":"i.34","spi":12172},{"ty":"as","st":"paragraph","si":8312,"ei":8312,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":8313,"ei":8313,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i"