ncrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="kTU5e09L7w6CvUJEO5yIParZBnE"  nonce="kTU5e09L7w6CvUJEO5yIParZBnE">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="kTU5e09L7w6CvUJEO5yIParZBnE"  nonce="kTU5e09L7w6CvUJEO5yIParZBnE">DOCS_modelChunk = [{"ty":"is","ibi":12644,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe issues and declamations of politics were carried to the people by newspapers—the media of the time. The great majority of papers were highly partisan. Editors and publishers, as the careers of Thurlow Weed and Horace Greeley illustrate, were often powerful political figures. Newspapers in the nineteenth century, author Charles Ingersoll observed, “were the daily fare of nearly every meal in almost every family; so cheap and common, that, like air and water, its uses are undervalued.” “Look into the morning trains,” Ralph Waldo Emerson marveled, which “carry the business men into the city to their shops, counting-rooms, workyards and warehouses.” Into every car the newsboy “unfolds his magical sheets,—twopence a head his bread of knowledge costs—and instantly the entire rectangular assembly, fresh from their breakfast, are bending as one man to their second breakfast.”\n\nJanuary 25, 2015\n\u001c211\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn addition to geometry, Lincoln’s solitary researches allowed him to study the astronomy, political economy, and philosophy that his fellow lawyers had learned in college. “Life was to him a school,” fellow circuit rider Leonard Swett observed, “and he was always studying and mastering every subject which came before him.”\n\nJanuary 25, 2015\n\u001c228\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNor did she spare him whenever she detected a blatantly conciliatory tone in his speeches or writings. While she conceded that “worldly wisdom certainly does impel a person to ‘swim with the tide’—and if they can judge unerringly which way the tide runs, may bring them to port,” she continued to argue for “a more elevated course” that would “reconcile one to struggling against the current if necessary\n\nJanuary 25, 2015\n\u001c229\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn Charles Sumner, Frances found a politician who consistently chose the elevated course she favored, even though he was often isolated as a result. Sumner, a bachelor, who, like Chase, was said to look like a statesman, with imperious, well-chiseled features, would often dine with the Sewards when Frances was in town. When she returned to Auburn, they kept up a rich correspondence. Sumner valued her unflagging confidence particularly during his early days in the Senate when his unyielding position on slavery provoked anger\n\nJanuary 25, 2015\n\u001c230\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cReflecting on “the number of invalids that exist among women exempted from Labour,” she suggested that the “want of fitting employment—real purpose in their life” was responsible.\n\nJanuary 25, 2015\n\u001c231\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cShe offered advice on political matters, critiqued his speeches, and expressed her passionate opinions about slavery. She encouraged his idealism, pressing him repeatedly to consider what should be done rather than what could be done. In his letters, he analyzed the personalities of his colleagues, confessed his fears, discussed his reactions to the books he was reading, and told her repeatedly how he loved her “above every other thing in the world.” He conjured images of the moon, whose “silver rays” they shared as they each sat in their separate homes “writing the lines” that would cross in the mail.\n\nJanuary 25, 2015\n\u001c232\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA HUMAN BEING,” the novelist Thomas\n\nJanuary 29, 2015\n\u001c237\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMann observed, “lives out not only his personal life as an individual, but also, consciously or subconsciously, the lives of his epoch and his contemporaries…if the times, themselves, despite all their hustle and bustle,” do not provide opportunity, he continued, “the situation will have a crippling effect.” More than a decade earlier, speaking to the Springfield Young Men’s Lyceum, Lincoln had expressed his concern that his generation had been left a meager yield after the “field of glory” was harvested by the founding fathers. They were a “forest of giant oaks,” he said, who faced the “task (and nobly they performed it) to possess themselves, and through themselves, us, of this goodly land,” and to build “upon its hills and its valleys, a political edifice of liberty and equal rights.” Their destinies were “inseparably linked” with the experiment of providing the world, “a practical demonstration” of “the capability of a people to govern themselves. If they\n\nJanuary 29, 2015\n\u001c237\n\u0011\n\u0011"},{"ty":"te","id":"i.35","spi":12653},{"ty":"te","id":"i.36","spi":13576},{"ty":"te","id":"i.37","spi":13940},{"ty":"te","id":"i.38","spi":14383},{"ty":"te","id":"i.39","spi":14951},{"ty":"te","id":"i.40","spi":15169},{"ty":"te","id":"i.41","spi":15817},{"ty":"te","id":"i.42","spi":15891},{"ty":"as","st":"paragraph","si":12644,"ei":12644,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":12645,"ei":12645,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si