"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":15783,"ei":15800,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":15820,"ei":15856,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":15857,"ei":15874,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":15894,"ei":16868,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":16869,"ei":16886,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="kTU5e09L7w6CvUJEO5yIParZBnE"  nonce="kTU5e09L7w6CvUJEO5yIParZBnE">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="kTU5e09L7w6CvUJEO5yIParZBnE"  nonce="kTU5e09L7w6CvUJEO5yIParZBnE">DOCS_modelChunk = [{"ty":"is","ibi":16894,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001csucceeded, they were to be immortalized; their names were to be transferred to counties and cities, and rivers and mountains; and to be revered and sung, and toasted through all time.” Because their experiment succeeded, Lincoln observed, thousands “won their deathless names in making it so.” What was left for the men of his generation to accomplish? There was no shortage of good men “whose ambition would aspire to nothing beyond a seat in Congress, a gubernatorial or a presidential chair; but such belong not to the family of the lion, or the tribe of the eagle.” Such modest aspirations, he argued, would never satisfy men of “towering genius” who scorned “a beaten path.” In 1854, the wheel of history turned. A train of events that mobilized the antislavery North resulted in the formation of the Republican Party and ultimately provided Lincoln’s generation with a challenge equal to or surpassing that of the founding fathers.\n\nJanuary 29, 2015\n\u001c238\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAt midnight, Douglas began his concluding speech, which lasted nearly four hours. At one point, Seward interrupted to ask for an explanation of something Douglas had said. “Ah,” Douglas retorted, “you can’t crawl behind that free nigger dodge.” In reply, Seward said: “Douglas, no man will ever be President of the United States who spells ‘negro’ with two gs.”\n\nJanuary 29, 2015\n\u001c242\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe were thunderstruck and stunned.” The fight to stem the spread of slavery would become the great purpose Lincoln had been seeking. Before speaking out against the Nebraska Act, Lincoln spent many hours in the State Library, studying present and past congressional debates so that he could reach back into the stream of American history and tell a clear, reasoned, and compelling tale. He would express no opinion on anything, Herndon observed, until he knew his subject “inside and outside, upside and downside.” Lincoln told Joshua Speed, “I am slow to learn and slow to forget that which I have learned. My mind is like a piece of steel, very hard to scratch any thing on it and almost impossible after you get it there to rub it out.”\n\nJanuary 30, 2015\n\u001c243\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThen the inspiration that possessed him took possession of his hearers also. His speaking went to the heart because it came from the heart. I have heard celebrated orators who could start thunders of applause without changing any man’s opinion. Mr. Lincoln’s eloquence was of the higher type, which produced conviction in others because of the conviction of the speaker himself.”\n\nJanuary 30, 2015\n\u001c245\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhile Douglas simply asserted his points as self-evident, Lincoln embedded\n\nJanuary 30, 2015\n\u001c246\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001chis argument in a narrative history, transporting his listeners back to their roots as a people, to the founding of the nation—a story that still retained its power to arouse strong emotion and thoughtful attention. Many of his arguments were familiar to those who had followed the Senate debate and had read Chase’s masterly “Appeal”; but the structure of the speech was so “clear and logical,” the Illinois Daily Journal observed, the arrangement of facts so “methodical,” that the overall effect was strikingly original and “most effective.” At the State Fair, and twelve nights later, by torchlight in Peoria, where the debate over the Kansas-Nebraska Act was repeated, Lincoln presented his carefully “connected view” for better than three hours. In order to make his argument, Lincoln decided to begin with nothing less than an account of our common history, the powerful narrative of how slavery grew with our country, how its growth and expansion had been\n\nJanuary 30, 2015\n\u001c246\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccarefully contained by the founding fathers, and how on this fall night in 1854 the great story they were being told—the story of the