","ts_fs_i":false}},{"ty":"as","st":"text","si":20893,"ei":21064,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":21065,"ei":21082,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="kTU5e09L7w6CvUJEO5yIParZBnE"  nonce="kTU5e09L7w6CvUJEO5yIParZBnE">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="kTU5e09L7w6CvUJEO5yIParZBnE"  nonce="kTU5e09L7w6CvUJEO5yIParZBnE">DOCS_modelChunk = [{"ty":"is","ibi":21090,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cgracefully educating while entertaining—in a word, communicating an enormously complicated issue with wit, simplicity, and a massive power of moral persuasion.\n\nJanuary 30, 2015\n\u001c247\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmoral persuasion. At the time the Constitution was adopted, Lincoln pointed out, “the plain unmistakable spirit of that age, towards slavery, was hostility to the principle, and toleration, only by necessity,” since slavery was already woven into the fabric of American society. Noting that neither the word “slave” nor “slavery” was ever mentioned in the Constitution, Lincoln claimed that the framers concealed it, “just as an afflicted man hides away a wen or a cancer, which he dares not cut out at once, lest he bleed to death; with the promise, nevertheless, that the cutting may begin at the end of a given time.” A\n\nJanuary 30, 2015\n\u001c247\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe doctrine of self government is right—absolutely and eternally right,” he argued, but to use it, as Douglas proposed, to extend slavery perverted its very meaning. “No man is good enough to govern another man, without that other’s consent. I say this is the leading principle—the sheet anchor of American republicanism.” If the Negro was a man, which Lincoln claimed he most assuredly was, then it was “a total destruction of self-government” to propose that he be governed by a master without his consent\n\nJanuary 30, 2015\n\u001c248\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen it is said that the institution exists; and that it is very difficult to get rid of it, in any satisfactory way, I can understand and appreciate the saying. I surely will not blame them for not doing what I should not know how to do myself.” And, finally, “when they remind us of their constitutional rights, I acknowledge them…and I would give them any legislation for the reclaiming of their fugitives.” Rather than upbraid slaveowners, Lincoln sought to comprehend their position through empathy\n\nJanuary 30, 2015\n\u001c248\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThough the cause be “naked truth itself, transformed to the heaviest lance, harder than steel,” the sanctimonious reformer could no more pierce the heart of the drinker or the slaveowner than “penetrate the hard shell of a tortoise with a rye straw. Such is man, and so must he be understood by those who would lead him.” In order to “win a man to your cause,” Lincoln explained, you must first reach his heart, “the great high road to his reason.” This, he concluded, was the only road to victory—to that glorious day “when there shall be neither a slave nor a drunkard on the earth.”\n\nJanuary 30, 2015\n\u001c249\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFinally, he observed, over four hundred thousand free blacks in the United States had been liberated at “vast pecuniary sacrifices” by white owners who understood something about the human rights of Negroes. “In all these cases it is your sense of justice, and human sympathy, continually telling you” that the slave is a man who cannot be considered “mere merchandise\n\nJanuary 30, 2015\n\u001c250\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cConservative and contemplative by temperament, he embraced new positions warily. Once he committed himself, however, as he did in the mid-fifties to the antislavery cause, he demonstrated singular tenacity and authenticity of feeling. Ambition and conviction united, “as my two eyes make one in sight,” as Robert Frost wrote, to give Lincoln both a political future and a cause worthy of his era.\n\nJanuary 30, 2015\n\u001c250\n\u0011\n\u0011\n\n\n6 The Gathering Storm\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOn the whole, it is perhaps as well for our general cause that Trumbull is elected.” Lincoln’s magnanimity served him well. While Seward and Chase would lose friends in victory—Seward by neglecting at the height of his success his old friend Horace Greeley, and Chase by not understanding the lingering resentments that followed in the wake of his 1849 Senate victory—Lincoln, in defeat, gained friends. Neither Trumbull nor Judd would ever forget Lincoln’s generous behavior. Indeed, both men would assist him in his bid for the U.S. Senate in 1858, and Judd would play a critical role in his run for the presidency in 1860.\n\nJanuary 30, 2015\n\u001c255\n\u0011\n\u0011"},{"ty":"te","id":"i.51","spi":21099},{"ty":"te","id":"i.52","spi":21297},{"ty":"te","id":"i.53","spi":21958},{"ty":"te","id":"i.54","spi":22505},{"ty":"te","id":"i.55","spi":23047},{"ty":"te","id":"i.56","spi":23671},{"ty":"te","id":"i.57","spi":24078},{"ty":"te","id":"i.58","spi":24537},{"ty":"as","st":"paragraph","si":21090,"ei":21090,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":tr