un_i":true,"ts_it_i":false,"ts_fs_i":false,"ts_ff_i":false,"ts_fgc":"#000000","ts_fgc_i":true,"ts_it":true,"ts_bd_i":false,"ts_va_i":true,"ts_fs":16.0,"ts_ff":"Droid Serif","ts_bd":false}},{"ty":"as","st":"text","si":24540,"ei":25166,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":25167,"ei":25184,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="kTU5e09L7w6CvUJEO5yIParZBnE"  nonce="kTU5e09L7w6CvUJEO5yIParZBnE">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="kTU5e09L7w6CvUJEO5yIParZBnE"  nonce="kTU5e09L7w6CvUJEO5yIParZBnE">DOCS_modelChunk = [{"ty":"is","ibi":25192,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFate seemed to take a curious delight in finding new ways to shatter his dreams.\n\nJanuary 30, 2015\n\u001c256\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cUnimaginable as it might seem, after Stanton’s bearish behavior, at their next encounter six years later, Lincoln would offer Stanton “the most powerful civilian post within his gift”—the post of secretary of war. Lincoln’s choice of Stanton would reveal, as would his subsequent dealings with Trumbull and Judd, a singular ability to transcend personal vendetta, humiliation, or bitterness. As for Stanton, despite his initial contempt for the “long armed Ape,” he would not only accept the offer but come to respect and love Lincoln more than any person outside of his immediate family\n\nJanuary 30, 2015\n\u001c260\n\u0011\n\u0011\n\n\n7 Countdown to the Nomination\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 20, 2015\n\u001c341\n\u0011\n\u0011\n\n\n8 Showdown in Chicago\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 20, 2015\n\u001c356\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHaving risen to power with fewer privileges than any of his rivals, Lincoln was more accustomed to rely upon himself to shape events. From beginning to end, he took the greatest control of the process leading up to the nomination. While Seward, at Weed’s suggestion, spent eight months wandering Europe and the Middle East to escape dissension at home, Lincoln earned the goodwill and respect of tens of thousands with a strenuous speaking tour that left a positive imprint on Republicans in five crucial Midwestern states. While Chase unwisely declined his invitation to speak at the lecture series in New York at Cooper Union, Lincoln accepted with\n\nFebruary 27, 2015\n\u001c371\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001calacrity, recognizing the critical importance of making a good impression in Seward’s home territory. In addition, Chase refused invitations to travel to New England and shore up his support. Ironically, despite repeated pledges in his diary to do anything necessary to achieve honor and fame, Chase showed a lack of resolution in the final weeks before the convention\n\nFebruary 27, 2015\n\u001c371\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cprecision with language—he rarely\n\nFebruary 27, 2015\n\u001c371\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001csaid more than he was sure about, rarely pandered to his various audiences—gave Lincoln great advantages over his rivals, each of whom tried to reposition himself in the months before the convention\n\nFebruary 27, 2015\n\u001c371\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001che took pains to reestablish rapport with Judd and Trumbull after they had defeated him in his first run for the Senate. His ability to rise above defeat and create friendships with previous opponents was never shared by Chase, who was unable to forgive those who crossed him\n\nFebruary 27, 2015\n\u001c373\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFinally, Lincoln’s profound and elevated sense of ambition—“an ambition,” Fehrenbacher observes, “notably free of pettiness, malice, and overindulgence,” shared little common ground with Chase’s blatant obsession with office, Seward’s tendency toward opportunism, or the ambivalent ambition that led Bates to withdraw from public office. Though Lincoln desired success as fiercely as any of his rivals, he did not allow his quest for office to consume the kindness and openheartedness with which he treated supporters and rivals alike, nor alter his steady commitment to the antislavery cause\n\nFebruary 27, 2015\n\u001c373\n\u0011\n\u0011\n\n\n9 “A Man Knows His Own Name”\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLincoln exhibited, Weed later wrote, “so much good sense, such intuitive knowledge of human nature, and such familiarity with the virtues and infirmities of politicians, that I became impressed very favorably with his fitness for the duties which he was not unlikely to be called upon to discharge.” Weed departed, ready to “go to work with a will\n\nMarch 7, 2015\n\u001c378\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLincoln always understood the importance of what he described as “the dry, and irksome labor” of building organizations to get out the vote, while most politicians preferred “parades, and shows, and monster meetings.”\n\nApril 3, 2015\n\u001c395\n\u0011\n\u0011\n\n\n10 “An Intensified Crossword Puzzle”\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthe president-elect “showed remarkable tact” with every caller. Listening patiently to each applicant, Lincoln revealed a