01c*\n\u001cfew, if any, emerge from his reception room without being strongly and favorably impressed with his general disposition.”\n\nApril 9, 2015\n\u001c408\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe sees all who go there, hears all they have to say, talks freely with everybody, reads\n\nAugust 5, 2015\n\u001c419\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe declared at one point that he would be willing to reduce his own life span by “a period of years” equal to the anxious months separating his election and the inauguration.\n\nAugust 9, 2015\n\u001c427\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cCompromises based on the idea that the preservation of the Union is more important than the liberty of nearly 4,000,000 human beings cannot be right. The alteration of the Constitution to perpetuate slavery—the enforcement of a law to recapture a poor, suffering fugitive…these compromises cannot be\n\nAugust 9, 2015\n\u001c439\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001capproved by God or supported by good men…. “No one can dread war more than I do,” she continued; “for 16 years I have prayed earnestly that our son might be spared the misfortune of raising his hand against his fellow man—yet I could not to day assent to the perpetuation or extension of slavery to prevent war. I say this in no spirit of unkindness…but I must obey the admonitions of conscience which impel me to warn you of your dangers.”\n\nAugust 9, 2015\n\u001c439\n\u0011\n\u0011\n\n\n11 “I Am Now Public Property”\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAugust 11, 2015\n\u001c444\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAugust 11, 2015\n\u001c445\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAugust 31, 2015\n\u001c461\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLincoln’s answer was simple, straightforward, and shrewd. “We needed the strongest men of the party in the Cabinet. We needed to hold our own people together. I had looked the party over and concluded that these were the very strongest men. Then I had no right to deprive the country of their services.” Seward, Chase, Bates—they were indeed strong men. But in the end, it was the prairie lawyer from Springfield who would emerge as the strongest of them all.\n\nAugust 31, 2015\n\u001c462\n\u0011\n\u0011\n\n\n12 “Mystic Chords of Memory”: Spring 1861\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThough passion may have strained, it must not break our bonds of affection.\n\nAugust 31, 2015\n\u001c471\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPerhaps this show of popular support softened the wrenching realization that his chance had come and gone. When a congressman argued with him that a certain politician would be disappointed if he didn’t get an appointment in the new administration, Seward lost his composure: “Disappointment! You speak to me of disappointment. To me, who was justly entitled to the Republican nomination for the presidency, and who had to stand aside and see it given to a little Illinois lawyer!”\n\nAugust 31, 2015\n\u001c471\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAugust 31, 2015\n\u001c473\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLincoln moved immediately to calm the anxieties of the Southern people, quoting an earlier speech in which he had promised that he had “no purpose, directly or indirectly, to interfere with the institution of slavery in the States where it exists. I believe I have no lawful right to do so, and I have no inclination to do so.” He turned then to the controversial Fugitive Slave Law, repeating his tenet that while “safeguards” should be put in place to ensure that free men were not illegally seized, the U.S. Constitution required that the slaves “shall be delivered upon claim of the party to whom such service or labor may be due.” Although he understood that the Fugitive Slave Law offended “the moral sense” of many people in the North, he felt compelled, under the Constitution, to enforce it.\n\nAugust 31, 2015\n\u001c473\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJune 13, 2017\n\u001c476\n\u0011\n\u0011"}
}'


